import React, { Component } from "react";
import "./SideBar.css";

export class SideBar extends Component {
  render() {
    const { physicians, current } = this.props;
    return (
      <div className="SideBar">
        <div>NOTABLE</div>
        <div>PHYSICIANS</div>
        <ul>
          physicians ? Array(physicians.length).fill().map((physician, i)=>(
          <li key={i + 1}>
            {physician.firstName} {physician.lastName}
          </li>
          ))
        </ul>
      </div>
    );
  }
}

export default SideBar;
